import React, { useState } from 'react';

const Toggle = ({ title, children }) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div>
      <h3 onClick={toggle}>{title}</h3>
      {isOpen && <div>{children}</div>}
    </div>
  );
};

export default Toggle;
